import React from 'react';

/*change this css file name according your css*/
import './Cubetemplate.css';


const Cubetemplate =props => (


    <div>
        
        
        
            <div>
                
                <div className="bigdiv">
                    <div className="cubebox">
                        <div className="boxcontent">
                            <div className="textbox">

                                {/* this is the topic */}
                                <h2>{this.props.title}</h2>

                                {/* the small description */}
                                <p>by {this.props.desc}</p>
                            </div>
                            <div className="innerimg"><img src={require(`./images/${this.props.source}`)} alt="Example" className="imgplace" /></div>

                        </div>
                    </div>
                </div>
                
            </div>

        <div className="spacer2"></div>

        
        
    </div>
    
        

    



);

export default Cubetemplate;
